import React, { useEffect, useState } from 'react';
import NavScrollExample from '../components/common/Navbar';
import Axiosinstance from '../config/Axiosinstances';
import Cards from '../components/common/Cards';
import { useNavigate } from 'react-router-dom';
import '.././pages/css/Home.css'; // Import your custom CSS file

function Home() {
  const [courtData, setCourtData] = useState([]);
  const navigate = useNavigate();

  useEffect(() => {
    getAllCourtsData();
  }, []);

  const getAllCourtsData = () => {
    Axiosinstance.get('/users/getAllcourtsData')
      .then((response) => {
        setCourtData(response.data);
      })
      .catch((err) => {
        if (err.response.data.message === 'unauthorized user') {
          localStorage.clear();
          navigate('/');
        }
      });
  };

  return (
    <>
      <NavScrollExample />
      
      <div className="carousel-container">
        {/* Bootstrap Carousel */}
        <div id="carouselExampleControls" className="carousel slide" data-bs-ride="carousel">
          <div className="carousel-inner">
            {/* Add your carousel items here */}
            <div className="carousel-item active">
              <img src=""className="d-block w-100" alt="Carousel Image 1" />
            </div>
            <div className="carousel-item">
              <img src="carousel-image2.jpg" className="d-block w-100" alt="Carousel Image 2" />
            </div>
            <div className="carousel-item">
              <img src="carousel-image3.jpg" className="d-block w-100" alt="Carousel Image 3" />
            </div>
          </div>
          <button className="carousel-control-prev" type="button" data-bs-target="#carouselExampleControls" data-bs-slide="prev">
            <span className="carousel-control-prev-icon" aria-hidden="true"></span>
            <span className="visually-hidden">Previous</span>
          </button>
          <button className="carousel-control-next" type="button" data-bs-target="#carouselExampleControls" data-bs-slide="next">
            <span className="carousel-control-next-icon" aria-hidden="true"></span>
            <span className="visually-hidden">Next</span>
          </button>
        </div>
      </div>

      <div className="container mt-4">
        <div className="row row-cols-1 row-cols-md-3 g-4">
          {courtData.map((court) => (
            <div key={court._id} className="col">
              <Cards court={court} />
            </div>
          ))}
        </div>
      </div>
    </>
  );
}

export default Home;
